import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import { SnackbarProvider } from 'notistack';  // Import only once
import * as serviceWorker from "./serviceWorker";  // Import only once

ReactDOM.render(
  <React.StrictMode>
    <SnackbarProvider
      maxSnack={3}
      anchorOrigin={{
        vertical: 'top',
        horizontal: 'center',
      }}
      autoHideDuration={2000}  // Set the duration for 2 seconds
    >
      <App />
    </SnackbarProvider>
  </React.StrictMode>,
  document.getElementById("root")
);

// Uncomment this if you want to register the service worker
// serviceWorker.unregister();
